INSERT INTO `question` VALUES (77,'2020-08-27 08:06:10',0,'2020-08-27 12:20:25',NULL,'	Anh/Chị vui lòng cho biết ý kiến về thời gian làm việc như sau: ',2,NULL,14,NULL,NULL),(89,'2020-08-31 09:39:41',0,'2020-09-09 16:43:12',NULL,'Anh/Chị có muốn tham gia các chương trình đào tạo giúp hoàn thiện kỹ năng và chuyên môn nghề nghiệp của mình?',2,NULL,16,NULL,NULL),(90,'2020-08-31 09:40:11',0,NULL,NULL,'Anh/Chị cho rằng công tác đào tạo có quan trọng không đối với nhân viên trong Công ty? ',2,NULL,16,NULL,NULL),(100,'2020-09-01 13:55:47',0,NULL,NULL,'Anh/Chị quan tâm đến những chương trình đào tạo nào sau đây và mong muốn được tham gia trong thời gian sắp tới?',5,'0003224',16,NULL,NULL),(101,'2020-09-01 13:57:06',0,NULL,NULL,'Với cá nhân mình, Anh/Chị đang cảm thấy mình cần hoàn thiện & còn yếu ở vấn đề nào?',5,'0003224',16,NULL,NULL),(102,'2020-09-01 14:07:52',0,NULL,NULL,'Anh/Chị đánh giá thế nào về công tác đào tạo hiện tại của Công ty?',2,'0003224',16,NULL,NULL),(103,'2020-09-01 14:11:51',0,'2020-09-09 16:51:20',NULL,'Theo Anh/Chị, nội dung đào tạo, chương trình đào tạo nội bộ đã phù hợp và hiệu quả chưa?',2,'0003224',16,NULL,NULL),(104,'2020-09-01 14:16:14',0,NULL,NULL,'Theo Anh/Chị, để làm tốt công việc hiện tại ở vị trí này, bạn cần đào tạo những nội dung nào sau đây',5,'0003224',16,NULL,NULL),(105,'2020-09-01 14:36:27',0,NULL,NULL,'Anh/Chị có thêm những đề xuất gì đối với công tác đào tạo của Công ty hiện nay? Hãy nêu ra ý kiến của bản thân đóng góp xây dựng để công tác đào tạo & phát triển của nhân viên ngày càng hoàn thiện.',1,'0003224',16,NULL,NULL),(106,'2020-09-09 16:47:34',0,'2020-09-09 16:52:00',NULL,'Để làm tốt công việc hiện tại ở vị trí này, Anh/Chị cần đào tạo những kiến thức chuyên môn nào? (VD: Phương pháp xây dựng thang bảng lương, đấu thầu cơ bản…)',1,'0003224',16,NULL,NULL),(109,'2020-09-29 09:13:30',0,NULL,NULL,'Anh chị sẵn sàng di chuyển vị trí làm việc về nhà máy Bình Dương (Khu CN Đại Đăng, Tp. Thủ Dầu Một, Tỉnh Bình Dương)',5,'admin',18,NULL,N